import React from 'react';
import useFetch from './useFetch';
import './App.css'; // Archivo CSS para los estilos

function App() {
  const { mensaje, object, error, loading } = useFetch("http://localhost:8092/api/showAll");

  const handleDelete = (id) => {
    // Lógica para eliminar el perfil con el ID `id`
    console.log(`Eliminar perfil con ID: ${id}`);
  };

  if (loading) return <p>Loading...</p>;
  if (error) return <div className="error">{error}</div>;
  if (mensaje) return <div className="message">{mensaje}</div>; // Estilo para mensaje

  return (
    <div className="app-container">
      {object && Array.isArray(object) && (
        object.map(profile => (
          <div key={profile.id} className="profile-card">
            <p className="profile-name">{profile.nombre} {profile.apellidos}</p>
            <p>Curso: {profile.curso}</p>
            <p>Año de Ingreso: {profile.anoIngreso}</p>
            <p>Nota Media: {profile.notaMedia}</p>
            <button className="delete-button" onClick={() => handleDelete(profile.id)}>Eliminar</button>
          </div>
        ))
      )}
    </div>
  );
}

export default App;
